(()=>{"use strict";const e=new class{constructor(e,t){this.title=e,this.subtitle=t}}("Lunch Generator","Enjoy your lunch!"),t=new class{constructor(e){this.footer=e}}("By Pimlada Kongkham"),n=new class{constructor(e){this.menu=e}randomizeLunches(){const e=["MELI-SALAD: with pita bread (Homemade eggplant puree w/ herbs and spices)","TYROPITA: Greek feta cheese pie","FETA STUFFED RED PEPPER: Oven-roasted red bell pepper stuffed w/ feta cheese & herbs","MERAKI CHEESE PLATTER: Assortment of feta, vlahotiri, goat cheese & tyrokafteri (spicy feta spread), accompanied w/ pita bread","MUSSELS: Steamed in light butter sauce","TENDER CRISPY CALAMARI: Served w/ lemon aioli sauce","OCTOPUS CAKES: Lightly breaded and served w/ a homemade lemon aioli sauce","GOAT CHEESE & BEET SALAD: Spinach, Walnuts, Goat Cheese, Fresh Beets, Balsamic Vinaigrette","ARTICHOKE SALAD: Arugula, Romaine, artichoke hearts, kalamata olives, shaved parmesan, white balsamic vinaigrette","RIBEYE STEAK: 16oz. grilled ribeye steak, served w/ Greek fries, grilled veggies & tzatziki"];document.getElementById("randomizeLunches").innerHTML=e[0],document.getElementById("random").addEventListener("click",(function(){for(let t=e.length-1;t>0;t--){let n=Math.floor(Math.random()*t),a=e[t];e[t]=e[n],e[n]=a}document.getElementById("randomizeLunches").innerHTML=e[0]}))}}("By Pimlada Kongkham. Thank you!");new class{constructor(){this.renderTemplate(),n.randomizeLunches()}renderTemplate(){const a=`\n      <h1>${e.title}</h1>\n      <h2>${e.subtitle}</h2>\n      <p>${n.menu}</p>\n      <button id="random">Let's Reveal!</button>\n      <p id="randomizeLunches"></p>\n      <footer>${t.footer}</footer>\n`;document.body.innerHTML=a}}})();